script: |
  super -f tsv -I q1920.sql | sort > q1920.out

inputs:
  - name: q1920.sql
    data: |
      SELECT DISTINCT - CAST ( - ( 56 ) AS INTEGER ) col2 FROM tab1 AS cor0 WHERE col1 * - col0 <> ( - - 42 ) + - + 83 * - + 95 + + col1;
  - name: tab1

outputs:
  - name: q1920.out
    data: |
      56
